import React, { Component } from 'react'
import Kletka from './Kletka/Kletka';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

export default class Pole extends Component {

    FormRow() {
        return (
          <React.Fragment>
            <Grid item xs={4}>
              <Paper >item</Paper>
            </Grid>
            <Grid item xs={4}>
              <Paper >item</Paper>
            </Grid>
            <Grid item xs={4}>
              <Paper >item</Paper>
            </Grid>
          </React.Fragment>
        );
      }

    render() {
        return (
            <>
            <Kletka />
            <Kletka />
            </>
        )
    }
}
